import React from 'react';

function Button(props) {
  var backgroundColor = props.type === 'submit' ? 'transparent' : 'black';

  return (
    <button
      style={{
        backgroundColor: backgroundColor,
        color: 'black',
        fontSize: '16px',
        padding: '1rem',
        marginTop: '6px',
        cursor: 'pointer',
        textAlign: 'center',
        textDecoration: 'none',
        border: 'none',
        borderBottom: 'solid black 1px',
      }}
    >
      {props.text}
    </button>
  );
}

export default Button;
